[{"location":"#ExoMol","page":"Home","title":"ExoMol","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for ExoMol.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#ExoMol.get_exomol_dataset-Tuple{Any, Any, Any}","page":"Home","title":"ExoMol.get_exomol_dataset","text":"get_exomol_dataset(molecule::String, isotopologue::String, dataset::String; \n                       force::Bool=false, cache_dir::Union{String,Nothing}=nothing)\n\nDownload a specific ExoMol dataset definition file as an artifact.\n\nArguments\n\nmolecule::String: Molecule formula (e.g., \"H2O\", \"CO2\", \"N2\")\nisotopologue::String: Isotopologue identifier (e.g., \"1H2-16O\", \"14N2\")\ndataset::String: Dataset name (e.g., \"POKAZATEL\", \"WCCRMT\")\nforce::Bool=false: Force re-download even if artifact exists\ncache_dir::Union{String,Nothing}=nothing: Optional custom cache directory\n\nReturns\n\nString: Path to the downloaded dataset definition file\n\nExamples\n\n# Download N2 WCCRMT dataset\ndataset_path = get_exomol_dataset(\"N2\", \"14N2\", \"WCCRMT\")\n\n# Download H2O POKAZATEL dataset with force reload\ndataset_path = get_exomol_dataset(\"H2O\", \"1H2-16O\", \"POKAZATEL\", force=true)\n\nNotes\n\nDownloads the JSON format dataset definition file, which contains metadata, and  the actual spectroscopic data files (.states, .trans, etc.).\n\n\n\n\n\n","category":"method"},{"location":"#ExoMol.parse_exomol_master-Tuple{String}","page":"Home","title":"ExoMol.parse_exomol_master","text":"parse_exomol_master(filepath::String)\n\nParse the ExoMol master file and return structured data.\n\nArguments\n\nfilepath::String: Path to the master file (JSON format)\n\nReturns\n\nReturns the parsed JSON structure\n\nExamples\n\nmaster_path = download_exomol_master()\ndata = parse_exomol_master(master_path)\n\n\n\n\n\n","category":"method"}]
